from collections import deque

class ChannelAutomaton:
    def __init__(self):
        self.mqueue = deque()

    def send(self, m, u, v):
        self.mqueue.append((m, u, v))

    def receive(self, u, v):
        if self.mqueue and self.mqueue[0][1] == u and self.mqueue[0][2] == v:
            return self.mqueue.popleft()[0]
        return None

class ProcessAutomaton:
    def __init__(self, vertex):
        self.vertex = vertex
        self.send_buffer = []
        self.max_value = None  # Initialize max_value to None
        self.neighbors = {}

    def add_neighbor(self, neighbor, channel, weight):
        self.neighbors[neighbor] = {'channel': channel, 'send': True, 'weight': weight}

    def initialize_max_value(self):
        self.max_value = max([info['weight'] for neighbor, info in self.neighbors.items()])

    def receive(self, m, v):
        if self.max_value is None or m > self.max_value:
            self.max_value = m
            self.send_buffer = [(v, m)]
            for neighbor in self.neighbors:
                self.neighbors[neighbor]['send'] = True
        elif m == self.max_value:
            self.send_buffer.append((v, m))
        for neighbor in self.neighbors:
            if neighbor == v:
                self.neighbors[neighbor]['send'] = False

    def send(self):
        return [(neighbor, self.max_value) for neighbor, info in self.neighbors.items() if info['send']]

