class ProcessAutomaton:
    def __init__(self, uid, is_root):
        self.uid = uid
        self.is_root = is_root
        self.parent = None
        self.neighbors = {}

    def add_neighbor(self, neighbor, channel):
        self.neighbors[neighbor] = channel

    def initialize_bfs(self):
        if self.is_root:
            self.parent = self.uid

    def explore_neighbors(self):
        if self.parent is not None:
            for neighbor, channel in self.neighbors.items():
                if neighbor != self.parent:
                    channel.send(self.uid, self.parent, neighbor)

    def update_parent(self, parent):
        self.parent = parent

class Network:
    def __init__(self, graph, root_uid):
        self.processes = {}
        self.channels = {}
        self.root_uid = root_uid
        self.initialize_network(graph)

    def initialize_network(self, graph):
        for uid in graph:
            is_root = uid == self.root_uid
            self.processes[uid] = ProcessAutomaton(uid, is_root)
        for uid, neighbors in graph.items():
            for neighbor, weight in neighbors.items():
                channel = ChannelAutomaton()
                self.channels[(uid, neighbor)] = channel
                self.processes[uid].add_neighbor(neighbor, channel)
                self.processes[neighbor].add_neighbor(uid, channel)

    def construct_bfs_tree(self):
        for process in self.processes.values():
            process.initialize_bfs()
        for process in self.processes.values():
            process.explore_neighbors()
        while any(process.parent is None for process in self.processes.values()):
            updated_this_iteration = False
            for uid, process in self.processes.items():
                if process.parent is None:
                    for neighbor, channel in process.neighbors.items():
                        received_message = channel.receive(neighbor, uid)
                        if received_message is not None:
                            process.update_parent(received_message)
                            process.explore_neighbors()
                            updated_this_iteration = True
                            break  # Break after processing one neighbor
                if updated_this_iteration:
                    break  # Break out of the loop once any process is updated
            if not updated_this_iteration:
                break  # If no process is updated in this iteration, break out of the loop to avoid infinite looping


