class SpanningTree:
    def __init__(self, root_uid):
        self.root_uid = root_uid
        self.tree = {}

    def add_edge(self, parent, child):
        if parent in self.tree:
            self.tree[parent].append(child)
        else:
            self.tree[parent] = [child]

    def construct_tree(self, bfs_tree):
        for uid, process in bfs_tree.items():
            if uid != self.root_uid:
                self.add_edge(process.parent, uid)

    def print_tree(self):
        print("Final Spanning Tree:")
        self.print_tree_recursive(self.root_uid, 0)

    def print_tree_recursive(self, node, depth):
        print("  " * depth + node)
        if node in self.tree:
            for child in self.tree[node]:
                self.print_tree_recursive(child, depth + 1)


