from collections import defaultdict, deque
import sys

class Graph:
    def __init__(self, vertices):
        self.V = vertices
        self.graph = defaultdict(list)

    def add_edge(self, u, v, w):
        self.graph[u].append((v, w))

    def print_solution(self, dist, parent):
        print("Vertex\tDistance\tParent")
        for v in range(self.V):
            print(f"{v}\t{dist[v]}\t\t{parent[v]}")

    def process_P(self, u):
        dist = [sys.maxsize] * self.V
        parent = [-1] * self.V
        dist[u] = 0
        parent[u] = u

        send = defaultdict(deque)
        send[u].append(0)

        while True:
            for v, w in self.graph[u]:
                for message in send[u]:
                    if message + w < dist[v]:
                        dist[v] = message + w
                        parent[v] = u
                        send[v].append(dist[v])

            if not send[u]:
                break

            send[u].clear()
            u = (u + 1) % self.V  # Go to next node in round-robin manner

        self.print_solution(dist, parent)

